					$scope.getutdata = function() {
						// resetting all the data
						$scope.legends = [];
						$scope.topPerformers = [];
						$scope.bottomPerformers = [];
						$scope.utdata = undefined;
						var url = "getMapData?iusNid="+ $scope.selectedIndicator.indicatorUnitSubgroupId+ "&timeperiodId=" + $scope.selectedTimeperiod.timePeriodId;
						$http
								.get(url)
								.then(
										function(response) {
											$scope.utdata = response.data;
											$scope.legends = $scope.utdata.legends ? $scope.utdata.legends
													: [];
											$scope.numberOfFirstslices = 0;
											$scope.numberOfSecondslices = 0;
											$scope.numberOfThirdslices = 0;
											$scope.numberOfFourthslices = 0;
											$scope.numberOfFifthslices = 0;
											$(".loader").css("display", "none");
											for(var i=0; i<$scope.utdata.dataCollection.length; i++){
												if($scope.utdata.dataCollection[i].cssClass == "firstslices")
													$scope.numberOfFirstslices++;
												else if($scope.utdata.dataCollection[i].cssClass == "secondslices")
													$scope.numberOfSecondslices++;
												else if($scope.utdata.dataCollection[i].cssClass == "thirdslices")
													$scope.numberOfThirdslices++;
												else if($scope.utdata.dataCollection[i].cssClass == "fourthslices")
													$scope.numberOfFourthslices++;
												else
													$scope.numberOfFifthslices++;
											}
											$scope.numberOfFifthslices = 75 - $scope.numberOfFirstslices - $scope.numberOfSecondslices - $scope.numberOfThirdslices 
											            - $scope.numberOfFourthslices;
											if ($scope.legends
													&& $scope.legends.length > 0) {
												for (var i = 0; i < $scope.legends.length; i++) {
													$scope.legends[i].key = $scope.legends[i].key == null ? $scope.legends[i].key
															: $scope.legends[i].key
																	.split(' - ')[0]
																	+ ' - '
																	+ $scope.legends[i].key
																			.split(' - ')[1];
												}
											}

										},function(){
											
										});
					};

