					$scope.exportTableData = function(id) {
						var htmls = "";
						var uri = 'data:application/vnd.ms-excel;base64,';
						var template = '<html xmlns:o="urn:schemas-microsoft-com:office:office" xmlns:x="urn:schemas-microsoft-com:office:excel" xmlns="http://www.w3.org/TR/REC-html40"><head><!--[if gte mso 9]><xml><x:ExcelWorkbook><x:ExcelWorksheets><x:ExcelWorksheet><x:Name>{worksheet}</x:Name><x:WorksheetOptions><x:DisplayGridlines/></x:WorksheetOptions></x:ExcelWorksheet></x:ExcelWorksheets></x:ExcelWorkbook></xml><![endif]--></head><body><table>{table}</table></body></html>';
						var base64 = function(s) {
							return window.btoa(unescape(encodeURIComponent(s)));
						};

						var format = function(s, c) {
							return s.replace(/{(\w+)}/g, function(m, p) {
								return c[p];
							});
						};
						
						var tab_text = '<table class="text-center" style="margin-top: 14px;"><tr><h2 style="color: #2565a7">'
								+ $scope.selectedIndicator.indicatorName
								+ '&nbsp; in &nbsp; '
								+ $scope.selectedTimeperiod.timeperiod 
								+ '</h2></tr></table>'
						
						tab_text += "<table border='2px'><tr bgcolor='#a5bad9 '>";
						var textRange;
						var j = 0;
						tab = document.getElementById(id); // id of table

						for (j = 0; j < tab.rows.length; j++) {
							tab_text = tab_text + tab.rows[j].innerHTML
									+ "</tr>";
							// tab_text=tab_text+"</tr>";
						}

						tab_text = tab_text + "</table>";
						tab_text = tab_text.replace(/<A[^>]*>|<\/A>/g, "");// remove
																			// if u
																			// want
																			// links
																			// in
																			// your
																			// table
						tab_text = tab_text.replace(/<img[^>]*>/gi, ""); // remove
																			// if u
																			// want
																			// images
																			// in
																			// your
																			// table
						tab_text = tab_text.replace(/<input[^>]*>|<\/input>/gi,
								""); // reomves input params

						var ctx = {
							worksheet : 'Worksheet',
							table : tab_text
						};

						var link = document.createElement("a");
						
							link.download = $scope.selectedIndicator.indicatorName
							+ "_" + $scope.selectedTimeperiod.timeperiod
							+ ".xls";
						
						link.href = uri + base64(format(template, ctx));
						link.click();
					};
					
